import React from 'react';

import { connect } from 'react-redux';


import {
    Container,
    Row,
    Col,
    Image
} from 'react-bootstrap';


const CHATBOT_ICON = require('../../assets/images/login/chatbot.png');
const CORE_AI_ICON = require('../../assets/images/login/coreai.svg');

function Pricing(props) {
    let { lang } = props;

    return (
        <div className="page-price">
            <Row className="justify-content-center" >
                <Col lg={12} className="d-flex ">
                    <h1 className="price-titre m-auto">Ready to try the first social media auto-moderation tool?</h1>
                </Col>
                <Col lg={12} className="d-flex">
                    <h1 className="price-titre m-auto">Get your Free trial today</h1>
                </Col>
                <Col lg={10} className="d-flex">
                    <h1 className="price-titre m-auto">Get your Free trial today</h1>
                </Col>
            </Row>
        </div>
    )
}


const mapStateToProps = (state) => ({
    lang: state.socialMediaR.lang,
});

export default connect(mapStateToProps, {})(Pricing);
